import React from 'react'

function Section() {
  return (
    <div className='h-full w-full bg-cover bg-center bg-no-repeat'
      style={{
        backgroundImage: `url("https://i.imgur.com/tKiAAhT.jpeg")`
      }}>
      <div>
        <h1>
          Model Y
        </h1>
      </div>

    </div>
  )
}

export default Section
